//vari√°veis do jogo
var canvas, ctx, ALTURA, LARGURA, maxPulos = 3, velocidade = 4, estadoAtual, record, img, personagem, check, jogando, scream, lose, levelUp, menu, 
      
pontosParaNovaFase = [10, 25, 50, 90, 140, 200, 270, 350, 440, 540],
faseAtual = 0,
         
labelNovaFase = {
texto: "",
opacidade: 0.0,
  
fadeIn: function(dt){
 var fadeInId = setInterval(function() {
    if (labelNovaFase.opacidade < 1.0)
      labelNovaFase.opacidade += 0.01;
   
   else{
     clearInterval(fadeInId);
   }
  }, 10 * dt);

},
  
fadeOut: function(dt){
 var fadeOutId = setInterval(function() {
    if (labelNovaFase.opacidade > 0.0)
      labelNovaFase.opacidade -= 0.01;
    
    else{
     clearInterval(fadeOutId);
   }
  }, 10 * dt);
}
}, 
    
labelNovaFase1 = {
texto: "",
opacidade: 0.0,
  
fadeIn: function(dt){
 var fadeInId = setInterval(function() {
    if (labelNovaFase1.opacidade < 1.0)
      labelNovaFase1.opacidade += 0.01;
   
   else{
     clearInterval(fadeInId);
   }
  }, 10 * dt);

},
  
fadeOut: function(dt){
 var fadeOutId = setInterval(function() {
    if (labelNovaFase1.opacidade > 0.0)
      labelNovaFase1.opacidade -= 0.01;
    
    else{
     clearInterval(fadeOutId);
   }
  }, 10 * dt);
}
},    
estados = {
jogar: 0,
jogando: 1,
perdeu: 2
},    
    
chao = {
y: 540,
x: 0,
altura: 50,

  
atualiza: function(){
this.x -= velocidade;
if (this.x <= -56)
  this.x += 56;
},
  
desenha: function(){
spriteChao.desenha(this.x, this.y);
spriteChao.desenha(this.x + spriteChao.largura, this.y);
}
},

bloco = {
x: 50,
y: 0,
altura: spriteBoneco.altura,
largura: spriteBoneco.largura,
gravidade: 1.8,
velocidade: 0,
forcaDoPulo: 23.6,
qntPulos: 0,
score:0,
  
atualiza: function(){
this.velocidade += this.gravidade;
this.y += this.velocidade;
  
if (this.y > chao.y - this.altura && estadoAtual != estados.perdeu){
    this.y = chao.y - this.altura;
    this.qntPulos = 0;
    this.velocidade = 0;
}  
}, 
pula: function(){
if (this.qntPulos < maxPulos)
 this.velocidade = -this.forcaDoPulo;
 this.qntPulos++;
},
reset: function(){
this.velocidade = 0;
this.y = 0;

  
if (this.score > record) {
localStorage.setItem ("record", this.score);
record = this.score;
}
  
velocidade = 4;
faseAtual = 0;
this.gravidade = 1.8;
  
this.score = 0;
},
desenha: function(){
spriteBoneco.desenha(this.x, this.y);
}
},
obstaculos = {
  _obs: [],
  _scored: false,
  sprites: [spriteObstacle],
  tempoInsere: 0,
  insere: function(){
  this._obs.push({
  x: LARGURA,
  // largura: 30 + Math.floor(21 * Math.random()),
  largura: 50,
  y: chao.y - Math.floor(30 + Math.random() * 90),
   sprite: this.sprites[Math.floor(this.sprites.length * Math.random())] 
  });
    this.tempoInsere = 50 + Math.floor(21 * Math.random());
    if (faseAtual == 1)
    this.tempoInsere = 45 + Math.floor(21 * Math.random());
    if (faseAtual == 2)
    this.tempoInsere = 40 + Math.floor(21 * Math.random());
    if (faseAtual == 3)
    this.tempoInsere = 37 + Math.floor(21 * Math.random());
    if (faseAtual == 4)
    this.tempoInsere = 35 + Math.floor(21 * Math.random());
    if (faseAtual == 5)
    this.tempoInsere = 33 + Math.floor(21 * Math.random());
    if (faseAtual == 6)
    this.tempoInsere = 31 + Math.floor(21 * Math.random());
    if (faseAtual == 7)
    this.tempoInsere = 29 + Math.floor(21 * Math.random());
    if (faseAtual == 8)
    this.tempoInsere = 27 + Math.floor(21 * Math.random());
    if (faseAtual == 9)
    this.tempoInsere = 25 + Math.floor(21 * Math.random());
    if (faseAtual == 10)
    this.tempoInsere = 23 + Math.floor(21 * Math.random())
  },
atualiza: function() {
if (this.tempoInsere <= 0)
  this.insere();
else
  this.tempoInsere--;
  
for (var i = 0, tam = this._obs.length; i < tam; i++) {
var obs = this._obs[i];
  
obs.x -= velocidade;
  
if (bloco.x < obs.x + obs.largura && bloco.x + bloco.largura >= obs.x && bloco.y + bloco.altura >= obs.y) 
estadoAtual = estados.perdeu;

if (bloco.x < obs.x + obs.largura && bloco.x + bloco.largura >= obs.x && bloco.y + bloco.altura >= obs.y)
jogando.pause();
  
if (bloco.x < obs.x + obs.largura && bloco.x + bloco.largura >= obs.x && bloco.y + bloco.altura >= obs.y)
scream.play();
  
if (bloco.x < obs.x + obs.largura && bloco.x + bloco.largura >= obs.x && bloco.y + bloco.altura >= obs.y)
lose.play();
  
if (bloco.x < obs.x + obs.largura && bloco.x + bloco.largura >= obs.x && bloco.y + bloco.altura >= obs.y)
lose.currentTime = 0;


else if (obs.x <= 0 && !obs._scored){
  bloco.score++;
  obs._scored = true;
  
  if (faseAtual < pontosParaNovaFase.length && bloco.score == pontosParaNovaFase[faseAtual])
    passarDeFase();
}
  
else if (obs.x <= -obs.largura){
this._obs.splice(i, 1);
tam--;
i--;
}  
}
},
  
limpa: function() {
this._obs = [];
},
  
desenha: function() {
for (var i = 0, tam = this._obs.length; i < tam; i++) {
var obs = this._obs[i];
obs.sprite.desenha(obs.x, obs.y);
}
}  
  
},
    
check = false;

menu = new Audio();
menu.src = "Menu.mp3";
menu.play();


jogando = new Audio();
  jogando.src = "Jogando.mp3";

levelUp = new Audio();
  levelUp.src = "sounds/Level Up.mp3"

scream = new Audio();
  scream.src = "sounds/SCREAM.mp3";

lose = new Audio();
  lose.src = "sounds/SAD MUSIC.mp3"
  
  if (check == false){ 
  check = true;  
}

function clique(event) {
if (estadoAtual == estados.jogando) 
  bloco.pula();
 
else if (estadoAtual == estados.jogar) {
  estadoAtual = estados.jogando;
  jogando.play();
  jogando.currentTime = 0;
  jogando.loop = true;
  menu.pause();
  check = false;
}
  
else if (estadoAtual == estados.perdeu && bloco.y >= 420 * ALTURA) {
  estadoAtual = estados.jogar;
  obstaculos.limpa();
  bloco.reset();
  check = true;
  menu.play();
  menu.currentTime = 0;
  lose.pause(); 
} 
}

function passarDeFase() {
  velocidade ++;
  faseAtual ++;
  levelUp.play();
  levelUp.currentTime = 0;
if(faseAtual == 4)
  bloco.gravidade = 2
  
  
  
  labelNovaFase.texto = "LEVEL " + faseAtual;
  labelNovaFase.fadeIn(0.4);
  labelNovaFase1.texto = "LEVEL " + faseAtual;
  labelNovaFase1.fadeIn(0.4);
  
  setTimeout(function() {
    labelNovaFase.fadeOut(0.4);
  }, 800);
  setTimeout(function() {
    labelNovaFase1.fadeOut(0.4);
  }, 800);
  
}
function main() {
  
 ALTURA = window.innertHeight;
 LARGURA = window.innerWidth;
 if (LARGURA >= 500){
     LARGURA = 608;
     ALTURA = 590;
   
 }

canvas = document.createElement("canvas");
canvas.width = LARGURA;
canvas.height = ALTURA;
canvas.style.border = "1px solid #000";


ctx = canvas.getContext("2d");
document.body.appendChild(canvas);
  
document.addEventListener("mousedown", clique); 

estadoAtual = estados.jogar
;
  menu.play();
record = localStorage.getItem("record");
  
if (record == null)
  record = 0;
img = new Image();
img.src = "data:image/png;base64,"

roda();
}
function roda() {
atualiza();
desenha();
  
window.requestAnimationFrame(roda);
  
}
function atualiza() {
  
  chao.atualiza();
  
  bloco.atualiza();
  if (estadoAtual == estados.jogando)
  obstaculos.atualiza();

}
function desenha() {
ctx.fillStyle = "#0000CD";
ctx.fillRect(0, 0, LARGURA, ALTURA);
 
bg.desenha(0, 0);

  
ctx.fillStyle = "#ffffff";
ctx.font = "50px Arial";
ctx.fillText(bloco.score, 30, 68);
ctx.fillStyle = "#000000";
ctx.font = "50px Arial";
ctx.fillText(bloco.score, 31, 69);

ctx.fillStyle = "rgba(255, 255, 255, " + labelNovaFase.opacidade + ")";
ctx.font = "50px Arial";
ctx.fillText(labelNovaFase.texto, canvas.width / 2 - ctx.measureText(labelNovaFase.texto).width / 2 - 1, canvas.height / 3 - 1);
  
ctx.fillStyle = "rgba(0, 0, 0, " + labelNovaFase1.opacidade + ")";
ctx.font = "50px Arial";
ctx.fillText(labelNovaFase1.texto, canvas.width / 2 - ctx.measureText(labelNovaFase1.texto).width / 2 , canvas.height / 3);
   
if (estadoAtual == estados.jogar){
spriteStart.desenha(LARGURA / 2 -125, ALTURA / 2 -70);
 } 
else if (estadoAtual == estados.perdeu) {
ctx.fillStyle = "red";
spriteFim.desenha(LARGURA / 2 -110, ALTURA / 2 -50);
spriteBarra.desenha(LARGURA / 2 -150, ALTURA / 2 -135);
spriteBarra.desenha(LARGURA / 2 -150, ALTURA / 2 -220);

  
ctx.save();
ctx.translate(ALTURA / 2, LARGURA / 2);
ctx.fillStyle = "#FFFFFF";


  
if (bloco.score > record)
spriteHighScore.desenha(LARGURA / 2 -400, ALTURA / 2 -515)
  
else if (record < 10)
  ctx.fillText("Record " + record, -90, -174);
  
else if (record >=10 && record < 100)
  ctx.fillText("Record " + record, -106, -174);
  
else if (record >=100 && record < 999)
  ctx.fillText("Record " + record, -126, -176);

if (bloco.score < 10)
  ctx.fillText(bloco.score, -8, -95);
  
else if (bloco.score >= 10 && bloco.score < 100)
  ctx.fillText(bloco.score, -21, -95);
  
  else 
   ctx.fillText(bloco.score, -50, -95);
  
  
ctx.fillStyle = "#000000";
  
if (bloco.score > record)
spriteHighScore.desenha(LARGURA / 2 -400, ALTURA / 2 -515)

else if (record < 10)
  ctx.fillText("Record " + record, -89, -173);
  
else if (record >=10 && record < 100)
  ctx.fillText("Record " + record, -105, -173);
  
else if (record >=100 && record < 999)
  ctx.fillText("Record " + record, -125, -175);

if (bloco.score < 10)
  ctx.fillText(bloco.score, -7, -94);
  
else if (bloco.score >= 10 && bloco.score < 100)
  ctx.fillText(bloco.score, -20, -94);
  
  else 
   ctx.fillText(bloco.score, -49, -94);
  
ctx.restore();
}
  
else if (estadoAtual == estados.jogando)
         obstaculos.desenha();

chao.desenha();  
bloco.desenha();
}


//inicializa o jogo
main();